import logo from "../../img/repologo.png";
import "./Style.css";
import {Link} from "react-router-dom"

function Footer() {
  return (
    <footer className="footer">
      <div className="div-footer-logo">
        <img className="footer-logo" src={logo} alt="" />
        <span className="footer-logo-texto">Copyright 2022 © Repo Inc.</span>
      </div>
      <div className="div-footer-nav">
        <Link to="/admin">Quem Somos</Link>
        <Link to="/admin">Log in</Link>
        <Link to="/admin">Log in</Link>
      </div>
    </footer>
  );
}

export default Footer;
